$_LANG['When enabled, all messages in helpdesk system (except those sent to requester) will be sent to mail server corresponding queue address. lms-rtparser script should be running on server. Messages won\'t be written directly to database, but on solely responsibility of rtparser script. Default: disabled.'] = 'Pokud je povoleno, všechny zprávy v systému helpdesk (kromě zpráv odesílaných žadeteli) budou odeslány na mailový server do odpovídají fronty adres. Skript lms-rtparser by měl být spuštěn na serveru. Zprávy nebudou zapsány přímo do databáze, ale budou pouze zpracovány skriptem rtparser. Výchozí: vypnuto.';
