$_LANG['Why you should register? If you register, we will know who\'s using LMS. Also, you will be listed (your company name and url) on LMS website. It\'s free. We don\'t gather any e-mails, snails or other info. We just keep your company name, url, unique installation id and your LMS version (but only for statistical purposes - we can\'t track your version by your name or installation id). In future, we plan to make available something like \'Registered LMS site\'. Summary: we will be happy if you fill form below and send it to us.'] = 'Proč vlastně ta registrace? Pokud se registrujete, budeme vědět kdo je uživatelem LMS. Dále pak se objeví vaše jméno (případně jméno vaší společnosti a url adresa) na webových stránkách LMS. Registrace je zdarma. Není naší snahou shromažďovat emailové adresy, hlemýždě ani jinou havěť. Vedeme v patrnosti pouze jméno vaší společnosti, url, unikátní id instalace a verzi vaší LMS (ale pouze a jen za účelem statistiky - nechceme a ani nemůžeme vás vystopovat na základě verze či vašeho jména nebo instalačního id). V budoucnu bychom rádi zřídili jakýsi \'Registr uživatelů LMS\'. Závěrem: budeme velmi šťastní, pokud vyplníte formulář který následuje a odešlete nám jej.';
